import "./LoginCard.css";

const LoginCard = () =>{
    return(
        <div className="box">
                <label>
                    Name:
                    <input type="text" name="name" />
                </label>
                <label>
                Password:
                    <input type="submit" value="Submit" />
                </label>
                    

                
        </div>
    )
}

export default LoginCard;
